import React from 'react';
import './App.css';

function Holamundo(){
  return <h1>Hola Mundo</h1>

}

function Bola(){
  return <div className="rodona"></div>
}

function Cuadrado(){
  return <div className="cuadrado"></div>
}

function Separador(){
  return <hr className="separador"></hr>

}
function Separadoruno(){
  return <hr className="separadoruno"></hr>

}

function Hola(props){
  return <h1>Hola{props.Hola}</h1>

}

function App() {
  return (
    <div>
    <Holamundo />
    <Bola />
    <Cuadrado />
    <Separador />
    <Separadoruno />
    <Hola />
    </div>
  );
}

export default App;
